import React from "react";
import { useState } from 'react';

function Form_() {
  const [formstep, setFormstep] = useState(2);
  return (
    <form>
      {
        formstep === 0 && (
          <section>
            <label>Full name</label>
            <input type="text" placeholder="Full name" name="FullName"></input>
          </section>
        )
      }
      {
        formstep === 1 && (
          <section>
            <label>Preffered Name</label>
            <input type="text" placeholder="Full name" name="FullName"></input>
          </section>
        )
      }
      {
        formstep === 2 && (
          <section>
            <label>Date of Birth</label>
            <input type="Date" placeholder="DD/MM/Y" name="dob"></input>
          </section>
        )
      }
      {
        formstep === 3 && (
          <section>
            <label>NIC number(Optional)</label>
            <input type="text" placeholder="Full name" name="FullName"></input>
          </section>
        )
      }

    </form>
  )
}

export default Form_
